$(document).ready(function(){
	
	$.fn.datepicker.defaults.format = "dd/mm/yyyy";
	$( "#dateStart" ).datepicker('update', last.getDate()+"/"+(last.getMonth()+1)+"/"+last.getFullYear());
	$( "#dateEnd" ).datepicker('update', today.getDate()+"/"+(today.getMonth()+1)+"/"+today.getFullYear());
	$( "#dateActualite" ).datepicker('update', today);
	

	$("#byCountryAsc").hide("");
	$("#byCountryDesc").hide("");
	$("#byDateAsc").hide("");
	
	

    //RECUPERATION DES VALEURS DE SELECT
    var x = document.getElementById("Pays").options;
    for(i=0; i < x.length; i++){
        listePays.push([x[i].value,x[i].label]);
    }
    var x = document.getElementById("typeActu").options;
    for(i=0; i < x.length; i++){
        listeThemes.push([x[i].value,x[i].label]);
    }
	
	
	
	//CHARGEMENT DE LA CARTE
	loadMap("Esri.WorldStreetMap");
	
	$('#dateStart').removeAttr("disabled");
	$('#dateEnd').removeAttr("disabled");
	$('#Pays').removeAttr("disabled");
	$('#typeActu').removeAttr("disabled");
	$('#keyword').removeAttr("disabled");
	
	
	// document.getElementById('buttonExportPdf').addEventListener('click', function() {
		
		// });

	
	sendAanalytics("loadPage","loadPage");
	$(".mapZone").fadeIn("slow");
	
	$(".wait").fadeOut("slow");
	
	
});


//ORDER
$("#byCountry").click(function(){
	$('#byCountry').addClass('sortSelected').removeClass('sortUnSelected');
	$('#byDate').addClass('sortUnSelected').removeClass('sortSelected');
	
	$("#byCountryAsc").show("");
	$("#byCountryDesc").hide("");
	$("#byDateAsc").hide("");
	$("#byDateDec").hide("");
	
	orderElement = "CAPTION_A0";
	orderWay = "ASC";
	
	//$('.orderButton').hide();
	
	FiltrerActualite();
});

$("#byCountryAsc").click(function(){
	orderWay = "DESC";
	$("#byCountryAsc").hide("");
	$("#byCountryDesc").show("");
	FiltrerActualite();
});
$("#byCountryDesc").click(function(){
	orderWay = "ASC";
	$("#byCountryDesc").hide("");
	$("#byCountryAsc").show("");
	FiltrerActualite();
});

$("#byDate").click(function(){
	$('#byDate').addClass('sortSelected').removeClass('sortUnSelected');
	$('#byCountry').addClass('sortUnSelected').removeClass('sortSelected');
	
	$("#byDateDec").show("");
	$("#byDateAsc").hide("");
	$("#byCountryDesc").hide("");
	$("#byCountryAsc").hide("");
	
	orderElement = "DATE_ACTUALITE";
	orderWay = "DESC";
	
	//$('.orderButton').hide();
	
	FiltrerActualite();
});

$("#byDateAsc").click(function(){
	orderWay = "DESC";
	$("#byDateAsc").hide("");
	$("#byDateDec").show("");
	FiltrerActualite();
});
$("#byDateDec").click(function(){
	orderWay = "ASC";
	$("#byDateDec").hide("");
	$("#byDateAsc").show("");
	FiltrerActualite();
});


$("#buttonExportPdf").click(function(){
	$(".wait").fadeIn("slow");
	$(".wait p").html("Plase wait we are preparing your document");
	if (typeof someObject == 'undefined') $.loadScript('js/imagesDataUrl.js', function(){
		/*********** PDF **********************/
		leafletImage(map, function(err, canvas) {
		var nbPages = 0;
		//EXPORT PDF
		var doc = new jsPDF();
		var pos = 0;
		var smallFontSite = 8;
		var extraSmallFontSite = 8;
		var superExtraSmallFontSite = 6;
		var tmpAcutalite = [];
		var tmpActualiteDetails = [];
		var tmpLineIndexToWrite = 0;
		var tmpActualiteExist = false;
		var posInform=0;
		var newPageAdded = false;

		//AJOUT DE LA CARTE
		
		var canvasDatas = canvas.outerHTML;

		var texte = canvasDatas.replace(/[^0-9 ]/gi, '');
		var arrayCanvas = texte.split(' ');
		//console.log(texte.split(' '));
		imgData= canvas.toDataURL('image/jpeg');
		heightCarte = (arrayCanvas[2]/(arrayCanvas[1]/190));
		doc.addImage(imgData, 'jpeg', 10, 45, 190,heightCarte);
		pos = 46+heightCarte;



		
		
		//AJOUT DE LA LEGENDE	
		/*BLEU*/ doc.addImage("data:image/jpeg;base64,", 'JPEG', 10, pos, 5,5);
		/*VERT*/ doc.addImage("data:image/jpeg;base64,", 'JPEG', 37, pos, 5,5);
		/*ORANGE*/ doc.addImage("data:image/jpeg;base64,", 'JPEG', 56, pos, 5,5);
		/*GRIS*/ doc.addImage("data:image/jpeg;base64,", 'JPEG', 73, pos, 5,5);
		doc.setFontSize(8);
		pos = pos + 4;
		doc.text(16, pos, "Natural disaster");
		doc.text(43, pos, "Epidemic");
		doc.text(62, pos, "Conflict");
		doc.text(79, pos, "Other");
		pos = pos + 10;

		//ECRITURE DE L'ENTETE
		doc.setTextColor("#ffffff");
		doc.setFillColor(0, 153, 255);
		doc.rect(10, 10, 190, 17, "F");
		doc.setFontSize(20);
		doc.setFontType("bold");
		doc.text(15, 18, "Weekly humanitarian snapshot");
		doc.setFontSize(12);
		doc.setFontType("normal");
		doc.text(16, 24, "West and Central Africa");
		doc.setFontSize(35);
		doc.text(160, 23, "OCHA");
		doc.setFontType("normal");
		imgData = 'data:image/jpeg;base64,';
		doc.addImage(imgData, 'png', 145, 12, 14, 14);

		//AFFICHAGE DES FILTRES
		doc.setTextColor("#000000");
		doc.setFontSize(smallFontSite);
		doc.text(10, 34, "Countries");
		doc.text(10, 38, "Themes");
		doc.text(10, 42, "Period");
		var textFiltrePays = "All"; 
		var textFiltreTheme = "All"; 
		
		if(filtresPays.length !=0){
			textFiltrePays = ArrayToVar2(filtresPays,listePays,", ");
		}
		doc.text(24, 34, ": "+textFiltrePays);
		
		if(filtresThemes.length!=0){
			textFiltreTheme = ArrayToVar2(filtresThemes,listeThemes,", ");
		}
		doc.text(24, 38, ": "+textFiltreTheme);
		
		var date1 = new Date(DateFrToDateEn($("#dateStart").val()));
		var date2 = new Date(DateFrToDateEn($("#dateEnd").val()));
		var period = TwoDateToText(date1,date2);
		doc.text(24, 42, ": "+period+"");

		//ECRITURE DU PIED DE PAGE
		doc.setTextColor("#a0a0a0");
		doc.setFontSize(extraSmallFontSite);
		var today = new Date();
		doc.text(10, 283, "Map data sources: UNCS, DevInfo, OCHA. Feedback: ocharowca@un.org Twitter: @OCHAROWCA");
		doc.setFontStyle("italic");
		doc.text(10, 286, "The boundaries and names shown and the designations used on this map do not imply official endorsement or acceptance by the United Nations.");
		doc.setFontStyle("normal");
		doc.setTextColor("#000000");
		nbPages++;
		ni = 0;
		writeCountry = true;
		console.log('listeActualites');
		console.log(listeActualites);
		
		
		
		for(i=0; i < listeActualites.length; i++) {
			
			//PAYS ET REGION
			doc.setFontSize(16)
			ni = i+1;
			var paysRegion = listeActualites[i][3];
			var paysRegionNext = "";
			if(ni<listeActualites.length){
				paysRegionNext = listeActualites[ni][3];
			}
			
			if(writeCountry){
				if((pos + 6)<280){
					doc.text(10, pos, paysRegion);
				}else{
					doc.addPage();
					nbPages++;
					pos = 10;
					doc.text(10, pos, paysRegion);
				}
			}

			if(paysRegionNext!=paysRegion){
				writeCountry = true;
			}else{
				writeCountry = false;
			}
			pos = pos+6.5;
				
				
			//TITRE ICONE DATE
			if((pos + 6)>280){
				doc.addPage();
				nbPages++;
				pos = 10;
			}
			
			//date
			doc.setFontSize(smallFontSite);
			var vDate = formattedDateFrench(new Date(listeActualites[i][9]));
			doc.text(20, pos, vDate);
			doc.setFontSize(10);
			doc.setTextColor("#0099ff");
			
			//titre
			doc.text(38, pos, listeActualites[i][7]);
			
			//image
			var imgData = "";
			var nomImage = listeActualites[i][0]+listeActualites[i][10];
			for(w=0; w < arrayImages.length; w++) {
				if(arrayImages[w][0]==nomImage)
				{
					imgData= arrayImages[w][1];
				} 
			}
			
			doc.addImage(imgData, 'JPEG', 10, (pos-5), 7, 7);
			doc.setTextColor("#000000");
			
			pos = pos+6;
			
			
			
			
			
			
			
			//DETAILS
			
			getInformDataForPDf(listeActualites[i][9], listeActualites[i][2], listeActualites[i][0]);

			/* ****** INFORM ******* */
			if(donneesInformPdf!=undefined){
				
				
				posInform = pos-2;
				
				//ADD INFORM LINK
				doc.setFontSize(6);
				doc.setTextColor("#ffffff");
				doc.text(10, (posInform+3), 'http://www.inform-index.org/');
				
				
				//inform logo
				imgData = 'data:image/jpeg;base64,';
				doc.addImage(imgData, 'JPEG', 10, posInform, 13, 2.5);
				posInform = posInform+4;
				doc.setTextColor("#000000");
				doc.setFontSize(10);
				/* ****** INFORM ******* */
			}
			
			
			var details = MakeToArray(listeActualites[i][8]);
			var iInf = 0;
			for(v=0; v < details.length; v++) {
				if((pos + 4)>280){
					doc.addPage();
					nbPages++;
					pos = 10;
					posInform = 10;
				}
				
				/* ****** INFORM ******* */
				if(donneesInformPdf!=undefined){
					if(donneesInformPdf.length>0){
						if(donneesInformPdf.length>v){
							iInf = v;
							console.log('posInform');
							console.log(posInform);
							//barres inform
							var valeurIndice = donneesInformPdf[iInf][1];
							var taillebarre = (valeurIndice/10)*26;
							doc.setFillColor(136, 136, 136);
							doc.rect(10, posInform, 26, 3.2, "F");
							
							switch(donneesInformPdf[v][2]) {
								case "rouge":
									doc.setFillColor(242, 91, 70);
									break;
								case "bleu":
									doc.setFillColor(103, 143, 203);
									break;
								case "vert":
									doc.setFillColor(193, 198, 120);
									break;
								case "marron":
									doc.setFillColor(245, 167, 127);
									break;
								default:
									doc.setFillColor(204, 204, 204);
							}
						
						
			
							doc.rect(10, posInform, taillebarre, 3.2, "F");
							
							//texte inform
							doc.setTextColor("#ffffff");
							doc.setFontType("bold");
							var texteIndice = ReduceText(donneesInformPdf[iInf][0],20);
							posInform = posInform+3;
							doc.setFontSize(superExtraSmallFontSite);
							doc.text(10.5, posInform, texteIndice+' '+valeurIndice);
							posInform = posInform+2;
							doc.setTextColor("#000000");
							doc.setFontType("normal");
						}
					}
				}
				/* ****** INFORM ******* */
				
				
				doc.setFontSize(smallFontSite);
				doc.text(38, pos, details[v]);
				pos = pos+4;
			}
			
			/* ****** INFORM ******* */
			//ajouter les barres retantes
			if(donneesInformPdf!=undefined){
				iInf++;
				if(iInf<=donneesInformPdf.length){
					for(v=iInf; v < donneesInformPdf.length; v++) {
						if((posInform + 4)>280){
							doc.addPage();
							nbPages++;
							posInform = 10;
							pos = 10;
						}
						
						//barres inform
						var valeurIndice = donneesInformPdf[v][1];
						var taillebarre = (valeurIndice/10)*26;
						doc.setFillColor(136, 136, 136);
						doc.rect(10, posInform, 26, 3.2, "F");
						
						switch(donneesInformPdf[v][2]) {
							case "rouge":
								doc.setFillColor(242, 91, 70);
								break;
							case "bleu":
								doc.setFillColor(103, 143, 203);
								break;
							case "vert":
								doc.setFillColor(193, 198, 120);
								break;
							case "marron":
								doc.setFillColor(245, 167, 127);
								break;
							default:
								doc.setFillColor(204, 204, 204);
						}
						
						doc.rect(10, posInform, taillebarre, 3.2, "F");
						
						//texte inform
						doc.setTextColor("#ffffff");
						doc.setFontType("bold");
						var texteIndice = ReduceText(donneesInformPdf[v][0],20);
						posInform = posInform+3;
						doc.setFontSize(superExtraSmallFontSite);
						doc.text(10.5, posInform, texteIndice+' '+valeurIndice);
						posInform = posInform+2;
						doc.setTextColor("#000000");
						doc.setFontType("normal");
					}
				}
			}
			/* ****** INFORM ******* */
			
			
			
			if(writeCountry){
				if(pos<posInform){
					pos = posInform+8;
				}else{
					pos = pos + 8;
				}
			}else{
				posInform = posInform+1;
				if(pos<posInform){
					pos = posInform +2;
				}else{
					pos = pos - 3;
				}
			}
		}
		
		//ECRITURES DES NUMEROS DE PAGES
		for(i=1; i <= nbPages; i++) {
			doc.setPage(i);
			doc.text(185, 294, "Page "+i+" of "+nbPages);
		}
		
		doc.setProperties({
			title: 'Weekly humanitarian snapshot for West and Central Africa',
			subject: 'Weeklies country: '+textFiltrePays+', themes: '+textFiltreTheme+' '+period,
			author: 'OCHA ROWCA',
			keywords: 'WCA, Weekly, Generated',
			creator: 'https://weekly-wca.unocha.org'
		});

		doc.save('Weekly '+period+'.pdf');
		$(".wait").fadeOut("slow");
		});
		/*********** PDF **********************/
	});
	
	
	
});

